import Particles from "react-particles";

function About() {
    return (
      <>
      <Particles
        params={{
          particles: {
            number: {
              value: 200,
              density: {
                enable: true,
                value_area: 1000,
              }
            },
          },
        }}
      />
      </>
    );
  }
  
  export default About;
